import logger from "../logger"

const { PDFDocument, StandardFonts, rgb, setFillingGrayscaleColor } = require('pdf-lib')
const fontkit = require('@pdf-lib/fontkit')
const JsBarcode = require('jsbarcode')
const toArray = require('stream-to-array')
const fs = require('fs')

const { createCanvas } = require('canvas')
const { rejects } = require('assert')
const canvas = createCanvas()

const PDF_DEFAULTS = {
    font: '',
    front: '', 
    inside: ''
}

const addPng = async ( pdfDoc, page, content, scale, x, y, width, height ) => {
    //const png = fs.readFileSync( FILEPATH + filename)
    if ( !content ) return
    const buff = Buffer.from( content, 'base64')
    const pngImage = await pdfDoc.embedPng(buff)

    const pngDims = pngImage.scale(scale)

    page.drawImage( pngImage, {
        x: x,
        y: y,
        width: width || pngDims.width,
        height: height || pngDims.height
    })
}

const addBarcode = async ( pdfDoc, page, id, height, width, x, y ) => {
    return new Promise( (resolve, reject) => {
        if ( !id ) return resolve()
        JsBarcode( canvas, id, { height: height, width: width, displayValue: true, lineColor: "#444444", fontSize: 10 } )
        const stream = canvas.createPNGStream()
        toArray( stream, async(err, arr) => {
            if ( err ) {
                reject(err)
                return 
            }

            let buffers = []
            for( let i = 0; i < arr.length; ++i ) {
                let part = arr[i]
                buffers.push( (part instanceof Buffer) ? part: Buffer.from(part) )
            }
            let buff = Buffer.concat(buffers)
            const barcodeImage = await pdfDoc.embedPng( buff )
            const barcodeDims = barcodeImage.scale(1.5)
            page.drawImage(barcodeImage, {
                x: x-barcodeDims.width/2,
                y: y,
                width: barcodeDims.width,
                height: barcodeDims.height
            })
            resolve()
        })
    })
}

const drawText = ( page, content, font, x, y, size, color ) => {
    if ( !content ) return
    const defaultSize = 32
    const defaultColor = rgb( 0, 0, 0 )
    if ( !size ) size = defaultSize
    if ( !color ) color = defaultColor 

    page.drawText( content, {
        x: x,
        y: y,
        size: size,
        font: font,
        color: color
    })
}
 
const drawDate = ( page, date, font, x, y, color ) => {
    if ( !date ) return
    let digits = date.split('')
    drawText( page, digits[5], font, x, y, null, color )
    drawText( page, digits[6], font, x+40, y, null, color )
    drawText( page, digits[8], font, x+84, y, null, color )
    drawText( page, digits[9], font, x+124, y, null, color )
    drawText( page, digits[0], font, x+168, y, null, color )
    drawText( page, digits[1], font, x+208, y, null, color )
    drawText( page, digits[2], font, x+248, y, null, color )
    drawText( page, digits[3], font, x+288, y, null, color )
}


export const createDDCC = (details) => {
    console.log(details)
    return new Promise( async(resolve, reject) => {
        const pdfDoc = await PDFDocument.create()


        //const font = await pdfDoc.embedFont(StandardFonts.Helvetica)
        pdfDoc.registerFontkit(fontkit)
        //const fontBytes = fs.readFileSync( FILEPATH + "Roboto-Regular.ttf" )
        const fontBytes = Buffer.from( PDF_DEFAULTS.font, 'base64')
        const font = await pdfDoc.embedFont( fontBytes )

        const page1 = pdfDoc.addPage( [1260, 891] )
        const page2 = pdfDoc.addPage( [1260, 891] )

        await addPng( pdfDoc, page1, PDF_DEFAULTS.front, 1.0, 0, 0 )
        await addPng( pdfDoc, page2, PDF_DEFAULTS.inside, 1.0, 0, 0 )

        drawText( page1, details.site, font, 692, 224 )

        drawText( page2, details.name, font, 52, 704 )
        drawText( page2, details.id, font, 52, 604 )
        if ( details.sex === 'male' ) {
            drawText( page2, '', font, 281, 550 ) // Male
        } else if ( details.sex === 'female' ) {
            drawText( page2, '', font, 452, 550 ) // Female
        }
        drawDate( page2, details.birthDate, font, 280, 604 )

        if ( details.dose1 ) {
            if ( details.dose1.qr ) {
                await addPng( pdfDoc, page1, details.dose1.qr, 0.5, 95, 390, 234, 234 )
            }
            drawDate( page2, details.dose1.date, font, 52, 314 )
            drawText( page2, details.dose1.lot, font, 380, 314 )
            drawText( page2, details.dose1.vaccine, font, 256, 260 )
            drawText( page2, details.dose1.hw, font, 256, 206 )
            if ( details.dose1.second ) {
                drawText( page2, '', font, 55, 51 )  // Yes 2nd Dose
            } else {
                drawText( page2, '', font, 165, 51 )  // No 2nd Dose
            }
            if ( details.dose1.date_due ) {
                drawDate( page2, details.dose1.date_due, font, 270, 51 )
            }
        }

        if ( details.dose2 ) {
            if ( details.dose2.qr ) {
                await addPng( pdfDoc, page1, details.dose2.qr, 0.5, 350, 390, 234, 234 )
            }
            drawDate( page2, details.dose2.date, font, 672, 704 )
            drawText( page2, details.dose2.lot, font, 1000, 704 )
            drawText( page2, details.dose2.vaccine, font, 885, 650 )
            drawText( page2, details.dose2.hw, font, 885, 596 )
        }

        addBarcode( pdfDoc, page1, details.hcid, 32, 2, 947, 308 ).then( async() => {
            const pdfBytes = await pdfDoc.save()
            resolve( pdfBytes )  
        }).catch(err => {
            reject(err)
        })

    })
}

export const createQRPDF = (qr) => {
    return new Promise( async(resolve, reject) => {
        const pdfDoc = await PDFDocument.create()

        //const png = fs.readFileSync( FILEPATH + filename)
        const buff = Buffer.from( qr, 'base64')
        const pngImage = await pdfDoc.embedPng(buff)

        const pngDims = pngImage.scale(1.0)
            
        const page = pdfDoc.addPage( [ pngDims.width, pngDims.height ] )

        page.drawImage( pngImage, {
            x: 0,
            y: 0,
            width: pngDims.width,
            height: pngDims.height
        })

        const pdfBytes = await pdfDoc.save()
        resolve( pdfBytes )  

    })
}
